// Bluebook.js

import React, { useState, useEffect } from 'react';
import { createBluebookApi } from '../../';

const Bluebook = () => {
  const [bluebookData, setBluebookData] = useState({
    bluebookName: '',
    registrationAuthority: '',
    vehicleClass: '',
    bluebookStatus: '',
    fuelType: '',
    vehicleAge: '',
    registrationDate: '',
    taxValid: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setBluebookData({ ...bluebookData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await createBluebookApi(bluebookData);
      alert('Bluebook entry created successfully');
      // Optionally clear the form fields after submission
      setBluebookData({
        bluebookName: '',
        registrationAuthority: '',
        vehicleClass: '',
        bluebookStatus: '',
        fuelType: '',
        vehicleAge: '',
        registrationDate: '',
        taxValid: ''
      });
    } catch (error) {
      console.error('Error creating bluebook entry:', error.message);
      alert('Error creating bluebook entry. Please try again.');
    }
  };

  return (
    <div>
      <h2>Create Bluebook Entry</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="bluebookName">Bluebook Name:</label>
          <input type="text" id="bluebookName" name="bluebookName" value={bluebookData.bluebookName} onChange={handleChange} required />
        </div>
        <div>
          <label htmlFor="registrationAuthority">Registration Authority:</label>
          <input type="text" id="registrationAuthority" name="registrationAuthority" value={bluebookData.registrationAuthority} onChange={handleChange} required />
        </div>
        <div>
          <label htmlFor="vehicleClass">Vehicle Class:</label>
          <input type="number" id="vehicleClass" name="vehicleClass" value={bluebookData.vehicleClass} onChange={handleChange} required />
        </div>
        <div>
          <label htmlFor="bluebookStatus">Bluebook Status:</label>
          <select id="bluebookStatus" name="bluebookStatus" value={bluebookData.bluebookStatus} onChange={handleChange} required>
            <option value="">Select Status</option>
            <option value="ACTIVE">Active</option>
            <option value="INACTIVE">Inactive</option>
          </select>
        </div>
        <div>
          <label htmlFor="fuelType">Fuel Type:</label>
          <select id="fuelType" name="fuelType" value={bluebookData.fuelType} onChange={handleChange} required>
            <option value="">Select Fuel Type</option>
            <option value="diesel">Diesel</option>
            <option value="petrol">Petrol</option>
            <option value="electric">Electric</option>
          </select>
        </div>
        <div>
          <label htmlFor="vehicleAge">Vehicle Age:</label>
          <input type="date" id="vehicleAge" name="vehicleAge" value={bluebookData.vehicleAge} onChange={handleChange} required />
        </div>
        <div>
          <label htmlFor="registrationDate">Registration Date:</label>
          <input type="date" id="registrationDate" name="registrationDate" value={bluebookData.registrationDate} onChange={handleChange} required />
        </div>
        <div>
          <label htmlFor="taxValid">Tax Valid:</label>
          <input type="date" id="taxValid" name="taxValid" value={bluebookData.taxValid} onChange={handleChange} required />
        </div>
        <button type="submit">Create Bluebook</button>
      </form>
    </div>
  );
};

export default Bluebook;
